import React from 'react';
import ReactFileReader from 'react-file-reader';

export default () => {

  const handleFiles = files => {
    let reader = new FileReader();
    reader.onload = function(e) {
      // Use reader.result
      alert(reader.result)
    }
    reader.readAsText(files[0]);
  }



  return (
    <div>
      Library
      <input type="file" id="fileInput"/>
    </div>
  );
}
